import React from 'react';
import classes from './Modal.module.css';

const Modal = (props) => {
    return (
        <div className={`${classes.modal} ${props.classes}`}>
            <div className={classes.backdrop}></div>
            <div className={classes.modal}></div>
        </div>
    );
};

export default Modal;
